import React from 'react';
import { Container } from 'reactstrap';

import Grid from './components/Grid';

const ThemeContext = React.createContext('light');

function App() {
  return (
    <ThemeContext.Provider value="dark">
      <Container>
        <Grid />
      </Container>
    </ThemeContext.Provider>
  );
}
export default App;
